import {
    OwpTextField,
    OwpButton,
    OwpSelectField,
    OwpDialog,
    OwpMessage,
    OwpTreeGrid,
    OwpSearchDateTimePickerMulti,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpDateTimePickerMulti,
} from 'owp/wrapper';
import React, { Component } from 'react';
import Formsy from 'formsy-react';
import { mutate } from 'owp/api';
import * as TGEvent from 'owp/TGEvent';

import Pop_C0204016 from './Pop_C0204016';


class DialogReweighing extends Component {
    constructor(props) {
        super(props);
        this.owpDialog = React.createRef();
        this.clickCreate = this.clickCreate.bind(this);
        this.onSave = this.onSave.bind(this);
        this.state = {
            FLAG: 'Y',
        };
    }

    handleChange = (event) => {
        this.setState({ [event.target.name]: event.target.value });
    };

    

    // 등록 화면 닫기
    createDialogClose = () => {
        this.setState({ createDialogOpen: false });
        this.owpDialog.handleClose();
    };

    // 등록 확인 화면 열기
    createCheckOpen = () => {

        this.setState({ createCheckOpen: true });
        this.setState({ popMessage: '저장하시겠습니까?' });
    };

    // 등록 확인 화면 닫기
    createCheckClose = () => {
        this.setState({ createCheckOpen: false });
    };

    onSave = async (type) => {
        const data = {
            cudtype: 'create',
            
        };

        const result = await mutate({
            url: '/createIpxCommoncode',
            data,
        })
            
    };

    clickCreate() {
        this.onSave('START');
    }

    render() {
        return (
            <OwpDialog
                title="확인자 로그인"
                callbackFunction={this.createDialogOpen}
                dialogButton="확인"
                dialogActions={
                    <React.Fragment>
                        <div className="flex items-center">
                            <Pop_C0204016/>
                            <OwpButton color="secondary" variant="outlined" onClick={this.createDialogClose}>
                                닫기
                            </OwpButton>
                        </div>
                    </React.Fragment>
                }
                innerRef={(ref) => (this.owpDialog = ref)}
                width="400px"
                height="auto"
            >
                <React.Fragment>
                    <Formsy>
                    <div style={{width:'100%'}}>
                        <div>
                            <table className="table table-bordered table-advance tlw5">
                                <tbody>
                                <tr>
                                    <th className="left b" width="120">확인자 ID</th>
                                    <td>
                                        <OwpTextField
                                            style={{ width: '100%' }}
                                            id={''}
                                            name={''}
                                            value="SKBT xxxx"
                                            withTable={false}
                                            disabled={false}
                                            className="mg0"
                                        />
                                    </td>
                                </tr>
                                <tr>
                                    <th className="left b" width="150">소공정명</th>
                                    <td>
                                    <OwpTextField
                                            style={{ width: '100%' }}
                                            id={''}
                                            name={''}
                                            value="장비확인"
                                            withTable={false}
                                            disabled={false}
                                        />
                                    </td>
                                </tr>
                                </tbody>
                            </table>
                        </div>
                    </div>
                    </Formsy>
                </React.Fragment>
            </OwpDialog>
        );
    }
}

export default DialogReweighing;
